import math

def fibonacci_series(n):
    a = 1
    b = 1
    series = [a, b]
    for _ in range(3, n + 1):
        sum = a + b
        series.append(sum)
        a = b
        b = sum

    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True
    is_prime_series = all((is_prime(num) for num in series))
    return (series, is_prime_series)

